import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
  mainContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "flex-start",
    justifyContent: "flex-start",
    backgroundImage: 'radial-gradient(circle at -40% -10%,#4f76f2,#0f1b41 60%)',
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    height: "100%",
  },
  innerContainer: {
    marginTop: theme.spacing(10),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    flexWrap: "wrap",
    justifyContent: "center",
    width: "27vw",
    height: "30vh",
    padding: "20px",
    margin: "100px 0",
    borderRadius: "10px"
  },
  submitButton: {
    marginTop: theme.spacing(2.5),
  },
  imgContainer:{
    display: "flex",
    flexDirection: "row",
    alignItems: "flex-end",
    justifyContent: "center",
    width: "100vw"
  },
  teamImg:{ 
      height: "300px",
      zIndex: "0"
  },
  iplLogo:{
      height: "50px",
      marginBottom: "10px",
  },
  root: {
    flexGrow: 1,
  },
}));
